import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonLabel, IonCheckbox, IonBadge } from '@ionic/react';
import React from 'react';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>ToDO List RESTful</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>

        <IonList>
          <IonItem>
            <IonCheckbox slot="start" />

            <IonLabel>
              This is a not for example
            </IonLabel>
            <IonBadge color="warning" slot="end">
              Priority: 3
            </IonBadge>
          </IonItem>
        </IonList>

      </IonContent>
    </IonPage>
  );
};

export default Home;
